    }

    function tokenOfOwnerByIndex(address owner, uint256 index) public view virtual override returns (uint256) {
        require(index < ERC721.balanceOf(owner), "ERC721Enumerable: owner index out of bounds");
        return _ownedTokens[owner][index];
    }

    /**
     * @dev See {IERC721Enumerable-totalSupply}.
     */
    function totalSupply() public view virtual override returns (uint256) {
        return _allTokens.length;

    }

    /**
     * @dev See {IERC721Enumerable-tokenByIndex}.
     */
    function tokenByIndex(uint256 index) public view virtual override returns (uint256) {
        require(index < totalSupply(), "ERC721Enumerable: global index out of bounds");
        return _allTokens[index];
    }

    function listItem(uint256 tokenId, uint256 price) external {
        // 确保价格大于0
        require(price > 0, "Price must be greater than zero");

        // 确保调用者是NFT的所有者
        require(ERC721.ownerOf(tokenId) == msg.sender, "You are not the owner of this NFT");

        // 将NFT从卖家转移到合约本身进行托管
        ERC721.transferFrom(msg.sender, address(this), tokenId);

        // 创建上架信息
        listings[tokenId] = Listing({
            seller: msg.sender,
            price: price
        });

        emit ItemListed(tokenId, msg.sender, price);
    }

    function buyItem(uint256 tokenId) external payable {
        // 获取NFT上架信息
        Listing memory listing = listings[tokenId];

        // 确保该NFT已上架
        require(listing.price > 0, "This NFT is not for sale");

        // 确保买家支付的金额足够
        require(msg.value == listing.price, "Incorrect price");

        // 删除上架信息
        delete listings[tokenId];

        // 将NFT转移给买家
        ERC721.transferFrom(address(this), msg.sender, tokenId);

        // 支付给卖家
        payable(listing.seller).transfer(msg.value);

        emit ItemSold(tokenId, msg.sender, listing.price);
    }

    function cancelListing(uint256 tokenId) external {
        // 确保调用者是NFT的卖家
        Listing memory listing = listings[tokenId];
        require(listing.seller == msg.sender, "You are not the seller");

        // 删除上架信息
        delete listings[tokenId];

        // 将NFT返还给卖家
        ERC721.transferFrom(address(this), msg.sender, tokenId);
    }

    function getOwnedNFTs(address owner) external view returns (uint256[] memory) {
        uint256 nftCount = balanceOf(owner);  // 获取该地址拥有的NFT数量

        uint256[] memory tokenIds = new uint256[](nftCount);  // 创建数组来存储Token ID

        for (uint256 i = 0; i < nftCount; i++) {
            tokenIds[i] = tokenOfOwnerByIndex(owner, i);  // 遍历获取每个NFT的Token ID
        }

        return tokenIds;  // 返回所有NFT的Token ID
    }

    function requestJsonData(string memory cid) public {
        Chainlink.Request memory req = _buildChainlinkRequest(jobId, address(this), this.fulfill.selector);
        // 设置请求的 URL 和 JSON 路径
        req._add("get", string(abi.encodePacked("https://magenta-adorable-stork-81.mypinata.cloud/ipfs/", cid, ".json")));
        // 发送请求
        _sendChainlinkRequestTo(oracle, req, fee);
    }

    // Callback function to receive the JSON response
    function fulfill(bytes32 _requestId, string memory _jsonData) public recordChainlinkFulfillment(_requestId) {
        jsonData = _jsonData;
    }

    function getJsonString() public returns (string memory){
        return jsonData;
    }


}

